        <script>
         
         function show() {
             var r = document.getElementById('roll').value;
             var k = document.getElementById('keep').value;
             var exp_sel = document.getElementById('exp');
             var exp = exp_sel.options[exp_sel.selectedIndex].value;
             var ones_sel = document.getElementById('ones');
             var ones = ones_sel.options[ones_sel.selectedIndex].value;
             var key = r+'k'+k+ones+exp;
             if (key[key.length-1]=='_') {
                 key = key.substr(0,key.length-1);
             }
             key = key.replace('__','_');
             document.getElementById('key').innerHTML = key;
             document.getElementById('avg').innerHTML = averages[key];
             document.getElementById('dev').innerHTML = std_deviations[key];

             var pts = plots[key].map(x=>x);
             pts.unshift([0,0]);
             var mx = Math.max.apply(null, pts.map( p => p[1] ) );
             var grow = 50 / mx;
             var pdf = pts.map(l => l[0]+','+(60-grow*l[1])).join(' ');
             document.getElementById('pdf').setAttribute('points', pdf);

             for (var y=1; y<9; y+=2) {
                 var v = mx * y / 8;
                 var vtxt = v.toFixed(1) + '%';
                 document.getElementById('y'+y).innerHTML = vtxt;
             }
             
             var cdf = pts.reduce((a, x, i) => [...a, [x[0], x[1] + (a[i-1] || [0,0])[1] ] ], []);
             var grow = 60 / cdf[cdf.length-1][1];
             var cdf_pts = cdf.map(l => l[0]+','+(grow*l[1])).join(' ');
             cdf_pts = '0,60 '+cdf_pts;
             document.getElementById('cdf').setAttribute('points', cdf_pts);

             for (var i of [10,15,20,30]) {
                 document.getElementById('tn'+i).innerHTML = (100-cdf[i-1][1]).toFixed(1)+'%';
             }
             var tn = document.getElementById('tn').value;
             document.getElementById('tncust').innerHTML = (100-cdf[tn-1][1]).toFixed(1)+'%';
             document.getElementById('custtn').innerHTML = tn;
         }

         function init(){
             document.getElementById('roll').addEventListener('change',show);
             document.getElementById('keep').addEventListener('change',show);
             document.getElementById('exp').addEventListener('change',show);
             document.getElementById('ones').addEventListener('change',show);
             document.getElementById('tn').addEventListener('change',show);
             var svg = document.getElementById('svg');
             for (var i=0; i<110; i+=10) {
                 var xlab = document.createElement('text');
                 xlab.setAttribute('x',i);
                 xlab.setAttribute('y',60);
                 xlab.innerHTML = i;
                 svg.appendChild(xlab);
             }
             show();
         }
         
        </script>
    </head>
